import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom'; // Изменено с useHistory на useNavigate

function HomePage() {
  const [area, setArea] = useState('');
  const [district, setDistrict] = useState('');
  const [rooms, setRooms] = useState('');
  const [floor, setFloor] = useState('');
  const [classType, setClassType] = useState('');
  const navigate = useNavigate(); // Обновлено для использования useNavigate
  const zona = "3) от ~ТТК до МКАД"
  const stadiya = "нижние этажи"
  const otdelka = "Есть"
  const srok = "4 кв 2023"
  const okrug = "ЮВАО"

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = {  district, okrug, area, rooms,floor, classType,srok,otdelka,zona,stadiya};

    fetch('http://127.0.0.1:8000/predict/', {
  method: 'POST',
  headers: {
    'Content-Type': 'application/json',
  },
  body: JSON.stringify(data),
})
    .then(response => response.json())
    .then(data => {
      navigate('/result', { state: { result: data } }); // Изменено на navigate
    })
    .catch(error => console.error('Error:', error));
  };
  const districtOptions = [
    { value: 'Комфорт', label: 'Комфорт' },
    { value: 'Бизнес', label: 'Бизнес' },
    { value: 'Комфорт', label: 'Комфорт' },]

  const roomOptions = [
    { value: '1', label: '1' },
    { value: '2', label: '2' },
    { value: '3', label: '3' },
  ]
  const neiborOptions = [
    { value: 'Хорошевский', label: 'Хорошевский' },
    { value: 'Красносельский', label: 'Красносельский' },
    { value: 'Ярославский', label: 'Ярославский' },
  ]
  return (
    <div>
      <h1>Предсказание цены на недвижимость</h1>
      <form onSubmit={handleSubmit}>
        <input
          type="number"
          placeholder="Площадь"
          value={area}
          onChange={(e) => setArea(e.target.value)}
          required
        />
        <select value={district} onChange={(e) => setDistrict(e.target.value)} required>
        <option value="">Выберите район</option>
        {neiborOptions.map((option) => (
    <option key={option.value} value={option.value}>{option.label}</option>
    ))}
          
        </select>
        <select value={rooms} onChange={(e) => setRooms(e.target.value)} required>
          <option value="">Количество комнат</option>
          {roomOptions.map((option) => (
    <option key={option.value} value={option.value}>{option.label}</option>
    ))}
        </select>
        <input
          type="number"
          placeholder="Этаж"
          value={floor}
          onChange={(e) => setFloor(e.target.value)}
          required
        />
        <select value={classType} onChange={(e) => setClassType(e.target.value)} required>
          <option value="">Класс квартиры</option>
          {districtOptions.map((option) => (
    <option key={option.value} value={option.value}>{option.label}</option>
    ))}
        </select>
        <button type="submit">Рассчитать цену</button>
      </form>
    </div>
  );
}

export default HomePage;
